import { Row } from "antd";
import React from "react";

import { ItemCard } from "./Cards";

function JeansItem() {
  const imgArray = [
    `https://hips.hearstapps.com/vader-prod.s3.amazonaws.com/1584477345-best-jeans-9-1584477328.jpg?crop=1xw:1xh;center,top&resize=480%3A%2A`,
    `https://hips.hearstapps.com/vader-prod.s3.amazonaws.com/1598898953-best-jeans-for-men-6-1598898919.jpg?crop=1xw:1xh;center,top&resize=480%3A%2A`,
    `https://hips.hearstapps.com/hmg-prod.s3.amazonaws.com/images/mavi-jeans-1551397594.jpg?crop=1xw:1xh;center,top&resize=480:*`,
    `https://shoptommy.scene7.com/is/image/ShopTommy/DM04423_911_FNT?wid=547&hei=730&fmt=jpeg&qlt=90%2C0&resMode=trilin&op_usm=0.8%2C1.0%2C6%2C0&iccEmbed=0&cropN=0.125%2C0%2C0.75%2C1&op_sharpen=1`,
  ];

  return (
    <div
      className="site-layout-background col-lg-12 p-4"
      style={{
        minHeight: "100%",
        minWidth: "100%",
        flexDirection: "row",
        backgroundColor: "lightgrey",
      }}
    >
      <Row gutter={10}>
        <ItemCard img={imgArray[0]} title="Denim Brand Jeans" price="2699" />

        <ItemCard
          img={imgArray[1]}
          title="Urban Classic Slim Jean"
          price="2199"
        />

        <ItemCard img={imgArray[2]} title="Slim Fit Denim Jean" price="2399" />

        <ItemCard
          img={imgArray[3]}
          title="Low Rise Skinny Fit Jean"
          price="2699"
        />
      </Row>
    </div>
  );
}

export default JeansItem;
